import React from 'react';
import { BrowserRouter, Routes, Route} from 'react-router-dom';
import './App.css';
import Ayuda1 from './components/Ayuda/Ayuda1';
import NavBar from './components/NavBar/NavBar.jsx';

function App() {
  return (
    <BrowserRouter>
      <Routes>
          <Route path='/'element={<NavBar/>}></Route>
          <Route path='/ayuda'element={<Ayuda1/>}></Route>
      </Routes>

    </BrowserRouter>

  );
}

export default App;
